import React, {Component} from 'react';
import { Col } from 'reactstrap';


class Child extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Col>
          <p className="card-title">Naveen</p>
      </Col>
    );
  }
}

export default Child;
